window.bookSummaryJSON = "<p>Break the rich boys.<br> It’s tricky, but doable.<br> Jerks like them don’t deserve to rule Burberry Prep.<br> No, Tristan, Zayd, and Creed are going to pay, and I plan to make an example of them.<br> Then, there’s Zack, the varsity football d*ck. Oh, and did I mention a prince just transferred to the academy? Whatever will I do with those two?<br> Revenge is wicked sweet; I can’t wait for a taste.</p> <p>Defend ourselves against the charity case.<br> We’re the Idols of the school, the kings of the campus.<br> Marnye Elizabeth Reed.<br> That girl is nothing like the ones we’re used to. We just can’t decide if we hate her...or love her.<br> She might come from nothing, but she sure is determined to stir up something at the academy.<br> She says she’ll meet our challenge dead-on; we’ll make sure she regrets that.</p> <p><b><i>Bad, Bad Bluebloods</i></b><b> is a 94,000-word reverse harem/dark high school bully romance novel. This is book two of four in the series. Contains foul language and sexual situations; any sex featured is consensual.</b></p>"; 
